export class FiveContinents extends Component {
  render() {
    return (
      <div>
          <div class="card bg-dark text-dark ">
            <img src="imges/africa.jpg" class="card-img" alt="card-img-overlay" width='300px'/>
            <div class="card-img-overlay">
            <h5 class="card-title"> africa</h5>

            </div>
          </div>
      </div>
    )
  }
}

export default FiveContinents
